import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import './index.css';
import Sdata from './Sdata'

ReactDOM.render(
    <div>
    <h1 class="heading_style">List of Netflix Series 2021</h1>

    <Card 
        sname = {Sdata[0].sname}
        imgsrc = {Sdata[0].imgsrc}
        title =  {Sdata[0].title}
        link = {Sdata[0].link}
    />
    <Card 
        sname = "Stranger Things"
        imgsrc = "https://m.media-amazon.com/images/M/MV5BN2ZmYjg1YmItNWQ4OC00YWM0LWE0ZDktYThjOTZiZjhhN2Q2XkEyXkFqcGdeQXVyNjgxNTQ3Mjk@._V1_.jpg"
        title = {Sdata[0].title}        link = "https://www.netflix.com/title/80057281"
    />
    <Card 
        sname = "ExtraCurricular"
        imgsrc = "https://m.media-amazon.com/images/M/MV5BNGQxMDcyOTEtZWZkNi00NzgwLWEzNjQtZmFhMGY5ZGRlMTdiXkEyXkFqcGdeQXVyMTMxODk2OTU@._V1_.jpg"
        title = {Sdata[0].title}        link = "https://www.netflix.com/title/80990668"
    />
    <Card 
        sname = "DARK"
        imgsrc = {Sdata[0].imgsrc}
        title = {Sdata[0].title}        link = {Sdata[0].link}
    />
    </div>,
    document.getElementById("root")
);
